import { Reset } from 'styled-reset';
import styled from 'styled-components';
import Article from './components/Article';
import Header from './components/Header';

function App() {
    return (
        <>
            <Reset />
            <div className="root">
                <Header />
                <MainStyle className="active">
                    <Article />
                    <Article />
                    <Article />
                </MainStyle>
            </div>
        </>
    );
}

const MainStyle = styled.div`
    &.active {
    }
`;

export default App;
